import React from "react";

function Footer() {
    return (
        <footer className="bg-gray-800 py-6">
            <div className="container mx-auto max-w-screen-lg text-white text-center text-sm">
                <p className="mb-1 inline-flex mr-2 text-white text-opacity-75 font-semibold">Crafted on 2020</p>
            </div>
        </footer>
    )
}

export default Footer;
